import React from "react";

const TooltipsAcitivity = (props) => {
  const { payload, active } = props;

  if (active && payload) {
    return (
      <div>
        <span>{`${payload[0].value}kg`}</span>
        <span>{`${payload[1].value}kcal`}</span>
      </div>
    );
  }

  return null;
};

export default TooltipsAcitivity
